import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('https://jsonplaceholder.typicode.com/posts')
      .then(response => setData(response.data));
  }, []);

  return (
    <div>
      {data.map(item => (
        <ul>
          <li>{item.id}</li>
          <li>{item.title}</li>
          <li>{item.body}</li>
        </ul>
      ))}
    </div>
  );
}

export default App;
